import React, { useState } from 'react'

// import link
import { Link, useSearchParams } from 'react-router-dom'
// import images
import intLOGO from '../../assets/images/interactlogo.SVG'
// import components



const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  }

  return (
    <>
      <header className='relative top-0 z-[20] mx-auto flex w-full items-center justify-between'>
      <img className='h-20 w-40' src={intLOGO} alt="" />
      <div className="w-1/3 flex justify-center gap-6">
        <Link to='/'>Home</Link> 
        <Link to='/'>About</Link> 
        <Link to='/'>Activities</Link> 
        <Link to='/'>Contact</Link> 
      </div>
      <div className="">
        <button onClick={toggleNavbar}>
          {isOpen ? <i class="ri-close-line"/> : <i class="ri-menu-2-line"/>}
          
        </button>
      </div>
      </header>
    </>
  )
}

export default Header
